 function songs(){
        var song = document.querySelector('.song');
        var img=document.getElementById('img')
        var audio=document.getElementById('audio')
        var songName=document.getElementById('song-name')
        var songArray=[
            {
                name:'Millionaire Song',
                img:'data:image/jpeg;base64,',
                song:'Millionaire_320(PagalWorld.com.sb).mp3'
            },
            {
                name:'Zaroor Song',
                img:'data:image/jpeg;base64,',
                song:'_Zaroor_320(PagalWorld.com.sb).mp3'
            },
            {
                name:'Mere Mehboob Mere Sanam',
                img:'data:image/jpeg;base64,',
                song:'Y2meta.app - Mere Mehboob Mere Sanam _ Bad Newz _ Vicky, Triptii, Ammy _ Anu, Lijo-DJ Chetas, Udit, Alka, Javed (128 kbps).mp3'
            },
            {
                name:'Aaj Ki Raat',
                img:'data:image/jpeg;base64,',
                song:'Aaj Ki Raat_320(PagalWorld.com.sb).mp3'
            }

        ]
        var playPauseBtn=document.getElementById('playPauseBtn')        
        playPauseBtn.addEventListener('click',()=>{
            if(audio.paused){
                audio.play()
            }
            else{
                audio.pause()
            }
        })
        var nextBtn=document.getElementById('nextBtn')
        let currentIndex = 0;
        nextBtn.addEventListener('click', () => {
            img.src = songArray[currentIndex].img;
            songName.innerHTML = songArray[currentIndex].name;
            audio.src = songArray[currentIndex].song;

            console.log(`hii${currentIndex + 1}`);
            currentIndex = (currentIndex + 1) % songArray.length;
        });


        var pre=document.getElementById('previous')
        pre.addEventListener('click', () => {
            img.src = songArray[currentIndex].img;
            songName.innerHTML = songArray[currentIndex].name;
            audio.src = songArray[currentIndex].song;
            console.log(`hii${currentIndex - 1}`)
            currentIndex = (currentIndex - 1 + songArray.length) % songArray.length;


        })
       
    }
    songs()